import React from 'react';
//import Lister from './functional/Lister.js';
//import Name from './Name.js';
import FormEssay from './Forms/FormEssay.js';
import Reservation from './Forms/FormReservation.js';
//import Repository from './Repository.js';
//import Greeting from './Greeting.js';
import Calculator from './Calculator.js';
import SignUpDialog from './SignUpDialog.js';
import SurfLog from './Logger.js';
import Footer from './Footer.js';
import Header from './Header.js';
import Home from './Home.js';
import BowlBuilder from './BowlBuilder.js'

import './css/App.css';

//const user = { firstName: 'Furious', lastName: 'Styles'};
const company = "KFA";
const surfLog =       <SurfLog />;
const guestList =     <SignUpDialog title="Guest List" message="Sign up"/>;
const reservation =   <Reservation />;
const essay =         <FormEssay className='mt-40'/>;
const tempConverter = <Calculator />;
const bowlBuilder =   <BowlBuilder />;
const home =          <Home />;

const components = {
  surfLog: <SurfLog />,
  guestList: <SignUpDialog title="Guest List" message="Sign up"/>,
  reservation: <Reservation />,
  essay: <FormEssay className='mt-40'/>,
  tempConverter: <Calculator />,
  bowlBuilder: <BowlBuilder />,
  home: <Home />
}
const componentTag = (current) => {
  return <div className="App">
            <Header company={company}/>
            {components[current]}
            <Footer />
          </div>
}

function App() {
  console.log(`window.location.pathname: ${window.location.pathname}`)
  if (window.location.pathname === "/Home") {
    return (
      componentTag('home')
    )
  } else if (window.location.pathname === "/BowlBuilder") {
    return (
      componentTag('bowlBuilder')
    )
  } else if (window.location.pathname === "/TempConverter") {
    return (
      componentTag('tempConverter')
    )
  } else if (window.location.pathname === "/Essay") {
    return (
      componentTag('essay')
    )
  } else if (window.location.pathname === "/Reservation") {
    return (
      componentTag('reservation')
    )
  } else if (window.location.pathname === "/GuestList") {
    return (
      componentTag('guestList')
    )
  } else if (window.location.pathname === "/SurfLog") {
    return (
      componentTag('surfLog')
    )
  } else {
    return (
      <div className="App">
        <Header company={company}/>
          {/*<Repository name="charliewilco/obsidian" />*/}
          <Home />
          <BowlBuilder />
          {/*TEMPERATURE CALCULATOR*/}
          <Calculator />
          {/*ESSAY INPUT*/}
          <FormEssay className='mt-40'/>
          {/*RESERVATION*/}
          <Reservation />
          {/*GUEST LIST*/}
          <SignUpDialog title="Guest List" message="Sign up"/>
          {/*SurfLog*/}
          <SurfLog />
          {/*FOOTER*/}
          <Footer />
      </div>
    );
  }
}

export default App;
